package com.company;

public class SpecialSubsquences {

    public static int subSequence(String A){
       int count =0;
       for(int i=0;i<A.length()-1;i++){
           if(A.charAt(i)=='A'){
               for(int j=i+1;j<=A.length()-1;j++) {
                   if(A.charAt(j)=='G'){
                       count++;
                   }
               }
           }
       }
       return count;
    }


    public static long subSequenceTwo(String A){
        long ans =0;
        long count =0;
        int n = A.length()-1;
        for(int i=n;i>=0;i--){
            if(A.charAt(i)=='G') count++;
            if(A.charAt(i)=='A') ans +=count;
        }
        return ans;
    }

    public static void main(String[] args) {

        System.out.println(subSequenceTwo(""));
    }
}
